import React, { useState } from "react";
import movies from "../movies";
import Movie from "./Movie";
import Nav from "./nav"

function Home() {
  
  return (
    <>
      
      <h1 className="home-h1">Featured Movies</h1>

      <div className="moviesss-container">
        {movies.map((data) => (
          <Movie
            id={data.id}
            year={data.year}
            title={data.title}
            poster={data.poster}
            genre={data.genre}
          />
        ))}
      </div>
    </>
  );
}

export default Home;
